const persona = {
  nombre: "Fernando",
  apellidos: "Herrera",
  edad: 30,
  direccion: {
    calle: "Av. España",
    numero: 123,
    piso: 2,
    departamento: "C",
  },
};

console.log(persona);

persona.direccion.calle = "Av. Independencia";

console.log(`La Edad de ${persona.nombre} es ${persona.edad}`);
